⠀
Loves going out to play. She shouts ‘out!’ several times a day. She also likes to play with her friends and wants to be close to them, but is still too shy to be friendly enough.
⠀
Eden is stubborn and crying for mom, as well as sticking to mom, keeping asking to pick her up and complaining a lot, wanting to sleep with mom both for her nap and at night time. However, she knows how to be cute and lovely, too.
⠀
She can speak very well with about 100 words. She even uses two words together such as ‘mom+ hand’ or ‘no+ water’. When we read a book, she loves to repeat mimetic words (onomatopoeia like "vroom vroom", which are very common and comprehensive in Korean).
⠀
She still has a problem eating which is never using her spoon or fork. She wants to eat only with her hands. Also she has new habit of putting her foot on her table.
⠀
Eden loves bath time, taking a bath for more than 30 minutes everyday and she especially loves bubble baths.
