15개월의 이든이는
⠀
밖에 나가 노는 걸 좋아해서 하루에도 몇 번씩 out!을 외쳐요. 친구도 좋아해서 친해지고 싶어하지만 아직 쑥스러움이 많아 쉽게 다가가지 못해요.
⠀
떼쟁이에 엄마 껌딱지가 되었어요. 계속 안아달라고 조르고 투정이나 어리광도 많이 부리고 밤에 잘 때도 꼭 엄마랑 같이 자고 싶어해서 가끔 엄마 아빠가 너무 힘들어요. 하지만 애교도 많이 늘어서 아주 사랑스러워요.
⠀
말이 아주 많이 늘어서 3음절의 단어도 발음할 수 있어요. 약 100단어 정도를 말할 수 있고, ‘엄마 + 손’, ‘물+아니야’ 처럼 두 개의 단어를 붙여서 말할 줄도 알아요. 책을 읽어줄 때엔 의성어 의태어를 따라 말하는 걸 좋아해요.
⠀
